(function($){$(document).ready(function(e){var formfield=null;var clicked='';$('#upload_image_button').click(function(e){clicked='floorplan';$('html').addClass('Image');formfield=$('#floorplan-image').attr('name');tb_show('','media-upload.php?type=image&TB_iframe=true');return false});$('#icon_image_button').click(function(e){clicked='marker';$('html').addClass('Image');formfield=$('#marker-icon').attr('name');tb_show('','media-upload.php?type=image&TB_iframe=true');return false});window.original_send_to_editor=window.send_to_editor;window.send_to_editor=function(html){var fileurl;if(formfield!=null){fileurl=$('img',html).attr('src');if(clicked=='floorplan'){$('#floorplan-image').val(fileurl)}else if(clicked=='marker'){$('#marker-icon').val(fileurl)}else{}tb_remove();$('html').removeClass('Image');formfield=null}else{window.original_send_to_editor(html)}}})})(jQuery);